import Fetchsample1 from './fetchsample/Fetchsample1';
//import Formiksample from './formsample/Formiksample';


export default function App() {

  const [onoff, setOnoff] = useState(false)




  return (
    <View>

      <Fetchsample1></Fetchsample1>
      {/* <Fetchpostsample></Fetchpostsample> */}
      {
        onoff ? (<View>On</View>) : (<View>Off</View>)
      }

      { <Button title='On -' onPress={() => setOnoff(!onoff)}>On - Off</Button> }
    </View>
  );

}
